description:
This is the recording of the famous show played by the Grateful Dead at the Winterland Arena in 1974. The files have been pulled off the Internet Archive&amp;#039;s streaming section and have properly labeled ID3 tags etc., etc. The encoding is MP3 VBR at 44,100 khz. The 28 recording tracks are as follows: (pulled from the Internet Archive)

U.S. Blues, Mexicali Blues, Brown Eyed Women, Beat It On Down The Line, Candyman, Jack Straw, China Cat Sunflower-&gt; I Know You Rider, El Paso, Loser, Playin&amp;#039; In The Band Cumberland Blues, It Must Have Been The Roses, Big River, Bertha, Weather Report Suite Prelude-&gt; Weather Report Suite Part 1-&gt; Let It Grow-&gt; Row Jimmy-&gt; Ship of Fools, Promised Land, Dark Star-&gt; Morning Dew, Sugar Magnolia, Not Fade Away-&gt; Goin&amp;#039; Down The Road Feelin&amp;#039; Bad-&gt; Not Fade Away, E: It&amp;#039;s All Over Now Baby Blue

Internet Archive page with streaming files: &lt;a href=&quot;
http://www.archive.org/details/gd74-02-24.sbd.windsor.199.sbefail.shnf&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.archive.org/details/gd74-02-24.sbd.windsor.199.sbefail.shnf&lt;/a&gt;

